// 在这个江湖中，有一项至高无上的任务 - 快马逐风术
// 凡是完成它者，能够使一群江湖儿女按照力量大小有序排列，
// 从而避免不必要的纷争。

// 如果武林中无人，则和平自然到；
function quickSort(arr) {
  if (arr.length <= 1) return arr;

  // 一派掌门，以自身武功为标准，
  // 分别将江湖英雄划入左军（低于掌门）、右翼（强于掌门）之列，
  const pivot = arr[0];
  const left = [];
  const right = [];

  // 从此遍历江湖上各路英雄豪杰，
  // 依照武功高低，分门别入，
  // 以期达到左右两边皆秩序井然，不乱一方。
  for (let i = 1; i < arr.length; i++) {
    if (arr[i] < pivot) {
      left.push(arr[i]);
    } else {
      right.push(arr[i]);
    }
  }

  // 以快速身法重排江湖新序。先是左军，其次掌门，最后右翼。
  // 以快打快，最终完成整个武林的秩序。
  return [...quickSort(left), pivot, ...quickSort(right)];
}
